import React from "react";
import Container from "@mui/material/Container";
import Grid from '@mui/material/Grid';
import Typography from "@mui/material/Typography";

const Footer = () => {
  return (
    <>
      <Container maxWidth="xl" sx={{ backgroundColor: "#0F1924", height: "auto", mt: 2 }}>
        <Grid container rowSpacing={1} columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
          <Grid item xs={3}>
            <Typography  sx={{color: "white", fontSize: "large", fontWeight: "bold"}}>PhoenixTech</Typography>
            <Typography sx={{color: "white"}}>
                Eco Intelligent Park, Unit No- 7E, 7th Floor, Block- EM, Plot-9,
                Salt Lake Sector-5, Kolkata 700091, India
              </Typography>
          </Grid>
          <Grid item xs={3}>
          </Grid>
          <Grid item xs={3}>
          </Grid>
          <Grid item xs={3}>
          </Grid>
        </Grid>
      </Container>
    </>
  );
};

export default Footer;
